import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './Home';
import Header from './Header';
import Footer from './Footer'
import Searchpage from './Searchpage';

function App() {
  return (
    <div className="App">
      <Router>
        <Header />

        <Switch>
          <Route path='/'>
            <Home />
          </Route>

          <Route path='/search'>
            <Searchpage />
          </Route>
        </Switch>

        <Footer />
      </Router>
    </div>
  );
}

export default App;
